import React from "react";
import { Link } from 'react-router-dom';

import "./style.css";


export function TeamPage(props) {
    const navSlide = () => {
        const burger = document.querySelector('.burger');
        const nav = document.querySelector('.nav-links')
        const navLinks = document.querySelectorAll('.nav-links li a')

        // Toggle Links
        nav.classList.toggle('nav-active')


        //Animate Links
        navLinks.forEach((link, index) => {
            if (link.style.animation) {
                link.style.animation = ''
            } else {
                link.style.animation = `navLinkFade 0.5s ease forwards ${index / 5 + 0.5}s`
            }
        })

        //Burger Animation
        burger.classList.toggle('toggle')
    }

    const login = () => window.location.href = 'http://localhost:5000/api/auth/discord'

    return (
        <body>
            <div className="nav">

                <div className="page-cont">
                    <ul className="nav-links">
                        <li><a className="aa" >Discord</a></li>
                        <li><a className="ab" >Faq</a></li>
                        <li><a className="ac" >Rules</a></li>
                        <Link to="/"><li><a className="ad" >Home</a></li></Link>
                    </ul>

                    <div className="burger" onClick={navSlide}>
                        <div className="line1"></div>
                        <div className="line2"></div>
                        <div className="line3"></div>
                    </div>
                </div>

                <button onClick={login} className="login-btn">
                    <a class="login-btn-logo"><i class="fab fa-discord"></i></a>
                    Login
                </button>
            </div>

            <div className="discord-container">
                <div className="discord" id="discord-page">
                    <h1><span className="s1">Simp</span><span className="s2">lify</span> <span className="s3">Develo</span><span className="s4">pment</span></h1>
                    <p>
                    The developers of Simplify wants to make things easy. <br/>
                    We put in the little extra touch, to make our users satisfied. <br/>

                    </p>
                </div>
            </div>
        </body>
    )
}
